import Api from './Api';

export default {
    saveAddr(credentials) {
        return Api().post('saveAddress', credentials)
    },
    fetchAllAddresses() {
        return Api().get('addresses')
    },
    setOwner(address, owner) {
        return Api().put('setowner', address, owner)
    },
    getad() {
        const items = {
            add: 'pl'
        }
        return Api().get('getad', items)
    },
}
